import { Card } from "react-bootstrap";
export default function PostContainer({ post }) {
  return (
    <Card>
      <Card.Header>{post.email}</Card.Header>
      <Card.Body>{post.text}</Card.Body>
      <Card.Footer>
        <img src={post.img} className="img-fluid"></img>
      </Card.Footer>
    </Card>
  );
}
